const items = $input.all();
const itemsToProcess = [];
const skippedDevices = [];
const alreadyFilledDevices = [];

function getDeviceType(serial) {
  if (serial.startsWith('C02') && serial.length >= 10) return 'Apple';
  if (serial.startsWith('CND')) return 'Dell';
  if (serial.match(/^(PC|PF|PG|MP|R)/)) return 'Lenovo';
  if (serial.match(/^\d+[A-Z]+$/)) return 'Lenovo';
  if (serial.startsWith('MP')) return 'Unknown';
  return 'Unknown';
}

function hasModel(item) {
  if (item.json.cells && Array.isArray(item.json.cells)) {
    const modelCell = item.json.cells.find(cell => cell.id === 'text_mkw78a6r');
    if (modelCell && modelCell.value && modelCell.value.trim() !== '') {
      return modelCell.value;
    }
  }
  return null;
}

