console.log(`ðŸ“‹ Found ${items.length} total items in Monday.com`);

items.forEach(item => {
  const serial = item.json.name?.trim();
  if (!serial) return;

  const deviceType = getDeviceType(serial);

  // Check if model already exists
  const existingModel = hasModel(item);

  if (existingModel) {
    console.log(`â¸ï¸ ${serial} - Model already exists: "${existingModel}" (skipped)`);
    alreadyFilledDevices.push({
      serial: serial,
      existingModel: existingModel,
      reason: 'Model already filled'
    });
  } else if (deviceType === 'Lenovo') {
    console.log(`âœ… ${serial} - Lenovo device (ID: ${item.json.id})`);
    itemsToProcess.push({
      json: {
        itemId: item.json.id,
        itemName: item.json.name,
        serialNumber: serial,
        deviceType
      }
    });
  } else {
    console.log(`â­ï¸ ${serial} - ${deviceType} device (skipped)`);
    skippedDevices.push({
      serial: serial,
      type: deviceType,
      reason: 'Not Lenovo device'
    });
  }
});

