const itemId = $('Filter Target Items Mac').item.json.itemId;
const serialNumber = $('Filter Target Items Mac').item.json.serialNumber;

console.log(`Processing ${serialNumber} for item ${itemId}`);

let modelName = 'MacBook Pro'; // Changed default

try {
  const response = $json;

  let xmlString = '';

  // Extract XML string from various response formats
  if (typeof response === 'string') {
    xmlString = response;
  } else if (response.body && typeof response.body === 'string') {
    xmlString = response.body;
  } else if (response.data && typeof response.data === 'string') {
    xmlString = response.data;
  } else {
    xmlString = JSON.stringify(response);
  }

  // Try to get model from XML configCode
  if (xmlString.includes('<configCode>') && !xmlString.includes('<error>')) {
    const configMatch = xmlString.match(/<configCode>([^<]+)<\/configCode>/);
    if (configMatch && configMatch[1]) {
      modelName = configMatch[1].trim();
      console.log(`Found from API: ${modelName}`);
      return {
        itemId,
        serialNumber,
        Name: modelName
      };
    }
  }

  // API returned error or no configCode - use serial pattern matching
  const serial = serialNumber.toUpperCase();

  // M3/M4 MacBook Pro patterns
  if (serial.startsWith('JNH')) modelName = 'MacBook Pro (M3 Pro)';
  else if (serial.startsWith('JMQ')) modelName = 'MacBook Pro (M4 Pro)';
  else if (serial.startsWith('JMR')) modelName = 'MacBook Pro (M4 Max)';
  // M3/M2 MacBook Air patterns
  else if (serial.startsWith('JLC')) modelName = 'MacBook Air (M3)';
  else if (serial.startsWith('JH')) modelName = 'MacBook Air (M2)';
  // Older patterns
  else if (serial.startsWith('FVFGK3')) modelName = 'MacBook Pro (M3 Pro)';
  else if (serial.startsWith('FVFGN')) modelName = 'MacBook Pro (M3 Max)';
  else if (serial.startsWith('FVFGL')) modelName = 'MacBook Air (M3)';
  else if (serial.startsWith('H66')) modelName = 'Mac mini (M1)';
  else if (serial.startsWith('C02')) modelName = 'MacBook Pro (Intel)';
  else if (serial.startsWith('CF')) modelName = 'MacBook Air (Intel)';
  // If no pattern matches, keep default 'MacBook Pro'

  console.log(`Result: ${modelName}`);

} catch (error) {
  console.log(`Error: ${error.message}`);
  // modelName stays as 'MacBook Pro'
}

console.log(`Final: ${serialNumber} -> "${modelName}" (Item: ${itemId})`);

